DROP PROCEDURE IF EXISTS `pa_nuevo_detalle_venta`$$
CREATE DEFINER=`admin`@`localhost` PROCEDURE `pa_nuevo_detalle_venta` (IN `_ventaId` INT, IN `_productoId` INT, IN `_cantidad` INT, IN `_fechaEstablecida` DATE, IN `_precio` DOUBLE, IN `_descuento` INT, IN `_porcentaje` DOUBLE)   BEGIN
    DECLARE done INT DEFAULT FALSE; -- Variable de control para ambos cursores
    DECLARE complete INT DEFAULT FALSE; -- Variable que rastrea cuando ya se saco la cantidad correspondiente
    DECLARE currentInventarioId INT; 
    DECLARE currentInventarioProductoId INT;
    DECLARE currentInventarioAlmacenId INT;
    DECLARE currentInventarioCantidad INT;
    DECLARE currentInventarioEstado ENUM('disponible', 'terminado', 'expirado', 'pausado');
    DECLARE currentAlmacenId INT; 

    -- Cursor para los almacenes, selecciona los almacenes ordenados por prioridad
    DECLARE curAlmacen CURSOR FOR SELECT almacenId FROM Almacenes ORDER BY prioridad;
    -- Cursor para los inventarios, selecciona los inventarios que no han vencido
    DECLARE curInventario CURSOR FOR SELECT inventarioId, productoId, almacenId, cantidad, estado FROM Inventario WHERE fechaVencimiento > CURDATE() OR fechaVencimiento IS NULL;

    -- Handler para el final de los cursores
    DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;

    OPEN curAlmacen;
    read_almacenes: LOOP
        FETCH curAlmacen INTO currentAlmacenId;

        IF done THEN
            SET done = FALSE; -- Reset para el siguiente cursor
        END IF;
        
        IF complete THEN
			LEAVE read_almacenes; -- Termina el algoritmo
		END IF;

        OPEN curInventario;
        read_inventario:LOOP
            FETCH curInventario INTO currentInventarioId, currentInventarioProductoId, currentInventarioAlmacenId, currentInventarioCantidad, currentInventarioEstado;

            IF done THEN
                LEAVE read_inventario;
            END IF;

            -- Comprueba si el inventario es del producto y almac√©n correctos
            IF currentInventarioProductoId = _productoId AND currentInventarioAlmacenId = currentAlmacenId THEN
                IF (currentInventarioEstado = 'disponible') AND (_cantidad <= currentInventarioCantidad)   THEN
                    -- Inserta el detalle de venta con la cantidad requerida
                    INSERT INTO Detalles_Venta 
                    VALUES (null, _ventaId, _productoId, currentInventarioId, _cantidad, _fechaEstablecida, NULL, _precio, _descuento, _porcentaje);
                    SET done = TRUE; -- Marca para salir del bucle de inventario
                    SET complete = TRUE; -- Marca que la cantidad requerida ya fue seleccionada y termina el algoritmo
                ELSE 
                    -- Inserta el detalle de venta con toda la cantidad disponible en el inventario actual
                    INSERT INTO Detalles_Venta 
                    VALUES (null, _ventaId, _productoId, currentInventarioId, currentInventarioCantidad, _fechaEstablecida, NULL, _precio, _descuento, _porcentaje);
                    -- Actualizar estado del inventario a terminado
                    UPDATE Inventario SET estado = 'terminado' WHERE inventarioId = currentInventarioId;
                    -- Resta la cantidad disponible en el inventario actual de la cantidad requerida
                    SET _cantidad = _cantidad - currentInventarioCantidad;
                END IF;
            END IF;
        END LOOP;
        CLOSE curInventario;
    END LOOP;
    CLOSE curAlmacen;
END$$

DROP PROCEDURE IF EXISTS `pa_nuevo_producto`$$
CREATE DEFINER=`admin`@`localhost` PROCEDURE `pa_nuevo_producto` (IN `_nombre` VARCHAR(100), IN `_descripcion` VARCHAR(500), IN `_precio` DOUBLE, IN `_activo` ENUM('t','f'), IN `_perecedero` ENUM('t','f'), IN `_codigoBarra` VARCHAR(30), IN `_minimo` INT, IN `_maximo` INT, IN `_img` LONGBLOB, IN `_categoriaId` INT, IN `_marcaId` INT, IN `_unidadMedidaId` INT, IN `_metodo` ENUM('peps','ueps'), IN `_cantidad` INT, IN `_almacenId` INT, IN `_comprobante` INT, IN `_fechaVencimiento` DATE, OUT `_producto` INT)   BEGIN
	
    IF (_cantidad IS NOT NULL) THEN
		IF (_perecedero = 't' AND _fechaVencimiento IS NULL) OR (_perecedero = 'f' AND _fechaVencimiento IS NOT NULL) THEN
			SIGNAl SQLSTATE '45000' SET MESSAGE_TEXT = 'Configuracion de vencimiento incorrecta';
		END IF;
		
		IF (_cantidad < _minimo) THEN
			SIGNAl SQLSTATE '45000' SET MESSAGE_TEXT = 'No puedes ingresar una menor cantidad al minimo';
		END IF;
		
		IF (_cantidad > _maximo) THEN
			SIGNAl SQLSTATE '45000' SET MESSAGE_TEXT = 'No puedes ingresar una mayor cantidad al maximo';
		END IF;
	END IF;
    
    START TRANSACTION;
	INSERT INTO Productos VALUES
    (null, _nombre, _descripcion, _precio, _activo, _perecedero, _codigoBarra,
     _minimo, _maximo, _img, _categoriaId, _marcaId, _unidadMedidaId, _metodo
    );
	SET _producto =  LAST_INSERT_ID();
	IF (_comprobante IS NULL AND _cantidad IS NOT NULL) THEN
		INSERT INTO Inventario VALUES
		(null, LAST_INSERT_ID(), _almacenId, _cantidad, CURDATE(),
		_comprobante, _fechaVencimiento, CURTIME(), 'disponible');
	END IF;
 
	SELECT 'Producto Ingresado Con Exito' AS 'message';
    COMMIT; 
END$$

