DELIMITER $$
CREATE TRIGGER `abono_cancelar` AFTER INSERT ON `abonos` FOR EACH ROW BEGIN
	DECLARE _amount FLOAT;
    DECLARE _total FLOAT;
    
    IF NEW.ordenId IS NOT NULL AND New.ventaId IS NULL THEN
		SELECT ROUND(ifnull(sum(IFNULL(monto, 0)), 0), 2) INTO _amount FROM Abonos WHERE ordenId = NEW.ordenId;
		SELECT ROUND(`Total`, 2) INTO _total FROM vw_ordenes WHERE id = NEW.ordenId;
    
		IF _amount >= _total THEN
			UPDATE Ordenes SET estado = 'pagada' WHERE ordenId = NEW.ordenId;
		END IF;
	ELSE
		SELECT ROUND(ifnull(sum(IFNULL(monto, 0)), 0), 2) INTO _amount FROM Abonos WHERE ventaId = NEW.ventaId;
		SELECT ROUND(`Total`, 2) INTO _total FROM vw_ventas WHERE id = NEW.ventaId;
    
		IF _amount >= _total THEN
			UPDATE Ventas SET estado = 'pagada' WHERE ventaId = NEW.ventaId;
		END IF;
    END IF;
END
$$
DELIMITER ;
